import {Avatar, Card} from 'antd';

const SkillCard=()=>{
    return(
        <Card avatar={<Avatar src="https://search.pstatic.net/common/?src=http%3A%2F%2Fblogfiles.naver.net%2FMjAyMDExMDVfMjEg%2FMDAxNjA0NTA2NDY5ODU4.aaA0xSO4IbY8yA5bjjR_CPnJJ-XWfNKs-Y_kPqrYtk0g.iDQeIKF0Rkh9mxEejY_ndxxFMa1PlIj7cnds-94ggR8g.PNG.0000kwak%2F20201104%25A3%25DF200649.png&type=sc960_832"/>}>
            <p>skillName</p>
            <p>skill Ability</p>
        </Card>
    )
}

export default SkillCard;
